package com.obpoo.gfsfabricsoftware.TransferStock.DataModel;import android.os.Parcel;import android.os.Parcelable;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.ArrayList;public class StockDocumentResponse implements Parcelable {    @SerializedName("status")    @Expose    private String status;    @SerializedName("message")    @Expose    private String message;    @SerializedName("data")    @Expose    private ArrayList<StockDocData> data = null;    protected StockDocumentResponse(Parcel in) {        status = in.readString();        message = in.readString();        data = in.createTypedArrayList(StockDocData.CREATOR);    }    public static final Creator<StockDocumentResponse> CREATOR = new Creator<StockDocumentResponse>() {        @Override        public StockDocumentResponse createFromParcel(Parcel in) {            return new StockDocumentResponse(in);        }        @Override        public StockDocumentResponse[] newArray(int size) {            return new StockDocumentResponse[size];        }    };    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }    public ArrayList<StockDocData> getData() {        return data;    }    public void setData(ArrayList<StockDocData> data) {        this.data = data;    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeString(status);        dest.writeString(message);        dest.writeTypedList(data);    }}